import React from 'react'
import ReactApexChart from 'react-apexcharts'

function Piechart(props) {
  let series= [props.city.reduce((a, b) => a + b, 0), 
    props.prod.reduce((a, b) => a + b, 0), 
    props.qo.reduce((a, b) => a + b, 0), 
    props.pe.reduce((a, b) => a + b, 0), 
    props.od.reduce((a, b) => a + b, 0), 
    props.pa.reduce((a, b) => a + b, 0), 
    props.month.reduce((a, b) => a + b, 0), 
    props.city.reduce((a, b) => a + b, 0), 
    props.sales.reduce((a, b) => a + b, 0)]

    let options= {
    chart: 
    {
      width: 380,
      type: 'pie',
    },
    labels: ['Order ID', 'Product', 'Quantity Ordered', 'Price Each', 'Ordered Data', 'Purchase Address', 'Month', 'City', 'Sales'],
    responsive: [{
      breakpoint: 480,
      options: {
        chart: {
          width: 200
        },
        legend: {
          position: 'bottom'
        }
      }
    }]
  }

    return (
      <div className="App">
          <ReactApexChart options={options} series={series} type={'pie'} height={650} />          
      </div>
    )
    }

export default Piechart
